import React from 'react'

const App = () => {
  const now = new Date()
  const a = 10
  const b = 20

  return(
    <div>
      <p>Hello Julius, it is {now.toString()}</p>
      <p>{a} plus {b} is equal to {a+b}</p>
    </div>
  )
}

export default App
